id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object. 
The path to the parameters file can be an absolute or relative path to a file.
CF_NAME update-service -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
Fornisci facoltativamente i parametri di configurazione specifici del servizio in un oggetto JSON valido in linea. 
CF_NAME update-service -c '{"name":"value","name":"value"}'

Facoltativamente, fornisci un file contenente i parametri di configurazione specifici del servizio in un oggetto JSON valido. 
Il percorso del file dei parametri può essere un percorso assoluto o relativo a un file. 
CF_NAME update-service -c PATH_TO_FILE

Esempio di oggetto JSON valido:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

